column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。オフロード仕様のダウンテールが、<br>
4WDの総帥「ランドクルーザー70」の走行性能をさらに向上！<br>
GRJ76Kだけの専用設計により、十分なトルク＆パワーアップで、<br>
低中速域での乗りやすさと胸のすくような加速感が味わえます。<br>
そして、心地よいサウンドが走る楽しさをさらにアップ！<br> 
ガナドールマフラーは、<br>
純正マフラーより10.7ｐｓアップの実測228.6ｐｓを生み出しました。<br>
トルクは当然アップしていますが、ガナドールマフラーは、<br>
純正マフラーより80回転低い値で1.5kgf mアップの<br>
MAXトルクを生み出しています。<br>
これは、 低回転からトルクを生み出し、<br>
非常に乗りやすい事を表しています。<br>
メーカーによる実測走行実験で燃費も11%改善！！<br>
新マフラー基準適合、車検対応商品。<br> 
ご注文後にメーカーから取り寄せする商品です。<br>
納期が必要ですのでご了承ください。<br>
マフラーは大型荷物のため送料を抑えるために、<br>
メーカーより直送のみの対応になります。<br>
そのため、代引きでの発送はできません。<br>
また送り先は、個人宅は不可で整備工場、ディーラー、<br>
専門ショップ等に限りらせていただきます。<br><!-- ここから リア受 -->
