排気効率を考えてつくられた機能美あふれたパイピングレイアウト。<br>
メインサイレンサーをフロント側に配した、フルサイズマフラーです。<br>
ガナドールマフラーの代名詞といえるスクエアテール左右4本出しが、<br>
アウトドア派のステータス「FJクルーザー」のリアビューにベストマッチ。<br>
パワフル＆ワイルド、そして走らせる喜びを呼び覚まします！<br>
P.B.S搭載マフラーは、<br>
純正マフラーより8.3ｐｓアップの実測269.1ｐｓを生み出しました。<br>
P.B.S搭載マフラーは、<br>
純正マフラーより310回転低い値でMAXトルクを生み出しています。<br>
これは、 低回転からトルクを生み出し、<br>
非常に乗りやすい事を表しています。<br>
簡単に言えば、 アクセルの踏み込みが少なくても、<br>
加速をするという事です。当然、燃費も比例して向上しています！<br>
新マフラー基準適合、車検対応商品。<br> 
